insert into lugar (id_lugar, nombre, descripcion) values (1, 'Machu Picchu', 'La ciudad sagrada de Machu Picchu, considerada una de las diez maravillas del mundo, fue declarada Patrimonio de la Humanidad por la Unesco en 1983. La ciudadela fue descubierta por Hiram Bingham en 1911 y se encuentra sobre una monta�a de granito, a unos 130 kil�metros de la ciudad de Cusco');
insert into lugar (id_lugar, nombre, descripcion) values (2, 'Mezquita Sheikh Zayed, Abu Dabi','La tercera mezquita m�s grande del mundo y la mayor de los Emiratos �rabes resulta a ojos de los turistas un lugar espectacular y absolutamente recomendable. Construida en honor al primer presidente del pa�s, la Mezquita Sheikh Zayed destaca por la altura de sus cuatro minaretes, que alcanzan los 107 metros, y por sus columnas -cuenta con 1048 en su exterior y 96 en su interior');
insert into lugar (id_lugar, nombre, descripcion) values (3, 'Angkor Wat, Siem Reap ','El templo de Angkor Wat est� considerado la mayor construcci�n religiosa jam�s realizada. Situada en la provincia de Siem Riep, en Camboya, es una de las partes integrantes de un vasto complejo de templos edificados en la zona de Angkor');
insert into lugar (id_lugar, nombre, descripcion) values (4, 'Bas�lica de San Pedro (Vaticano)','El cuarto sitio imprescindible en opini�n de los viajeros de TripAdvisor es la bas�lica de San Pedro del Vaticano, uno de los rincones m�s sagrados del catolicismo.');
insert into lugar (id_lugar, nombre, descripcion) values (5, 'Taj Mahal, Agra','Y es que esta joya hist�rica, fruto del amor, es un gran mausoleo de m�rmol blanco construido por el emperador mongol Shah Jahan en honor su esposa favorita fallecida durante el parto de uno de sus hijos. ');
insert into lugar (id_lugar, nombre, descripcion) values (6, 'Mezquita-Catedral de C�rdoba','La Mezquita-Catedral de C�rdoba es, como en a�os precedentes, la atracci�n tur�stica preferida por los viajeros de todo el mundo, a tenor de los comentarios y opiniones plasmados en el portal de TripAdvisor.');
insert into lugar (id_lugar, nombre, descripcion) values (7, 'Iglesia del Salvador sobre la sangre derramada, San Petersburgo','la iglesia del Salvador sobre la sangre derramada, caracterizada por una pintoresca silueta multicolor, se ha convertido en uno de los edificios m�s emblem�ticos de San Petersburgo. ');
insert into lugar (id_lugar, nombre, descripcion) values (8, 'La Alhambra, Granada','La antigua y extraordinaria ciudad amurallada granadina est� considerada la m�xima expresi�n del arte musulm�n en Europa. Cruzar las murallas de la Alhambra supone retroceder mil a�os.');
insert into lugar (id_lugar, nombre, descripcion) values (9, 'Piscina reflectante del monumento a Lincoln, Washington DC','La piscina reflectante del monumento a Lincoln en el National Mall es todo un s�mbolo de la capital americana. Dise�ado por Henry Bacon y construido a principios de los a�os 20 del siglo pasado, ha sido escenario de grandes acontecimientos hist�ricos, como el famoso discurso de Martin Luther King de 1963.');
insert into lugar (id_lugar, nombre, descripcion) values (10, 'Duomo de Mil�n (Italia)','El Duomo de Mil�n, la catedral g�tica convertida en el aut�ntico s�mbolo de la ciudad, no deja indiferente ni por su belleza ni por sus dimensiones -es uno de los templos cat�licos m�s grandes del mundo, con capacidad para 40.000 personas-. ');
insert into lugar (id_lugar, nombre, descripcion) values (11, 'Puente Golden Gate, San Francisco','El Golden Gate, el emblem�tico puente de San Francisco que une la pen�nsula por el norte con Marin, fue inaugurado en 1937. Desde entonces y hasta 1964, su estructura, considerada por la American Society of Civil Engineers una de las maravillas del mundo moderno, fue el puente colgante m�s largo del mundo. ');
insert into lugar (id_lugar, nombre, descripcion) values (12, 'Museo-iglesia de Santa Sof�a, Estambul','El monumento m�s espectacular del arte bizantino tiene un nombre: Santa Sof�a y se encuentra en Estambul. Construida en el siglo IV, fue durante sus diez primeros siglos catedral cristiana para convertirse en 1453 en mezquita, uso que se mantuvo hasta 1935, cuando se transform� definitivamente en museo');
insert into lugar (id_lugar, nombre, descripcion) values (13, 'Grand Place, Bruselas','En la Grand Place de Bruselas, la gran joya de la capital belga, convergen edificios renacentistas, g�ticos, neocl�sicos y de estilo flamenco, en una armon�a que la ha llevado a ser considerada una de las m�s hermosas de Europa. ');
insert into lugar (id_lugar, nombre, descripcion) values (14, 'Torre Eiffel, Par�s','Esta estructura de hierro, cuya construcci�n se inici� el 26 de enero de 1887, se ha convertido no s�lo en el emblema de Par�s, sino en el aut�ntico s�mbolo de Francia. ');
insert into lugar (id_lugar, nombre, descripcion) values (15, 'Catedral de Notre Dame, Par�s ','La gran catedral de Par�s y uno de los templos g�ticos m�s antiguos del continente, Notre Dame, se sit�a en el puesto n�mero en el ranking de atracciones tur�sticas m�s populares del mundo, seg�n los viajeros de TripAdvisor.');
